<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>skipNumber</title>
</head>
<body>
    
    <script>
          for(let i=1; i<=50; i++){
                if(i!=10 && i!=20 && i!=30 && i!=40 && i!=50)
                // if(i%10!=0)
                    document.write(`${i} <br>`)
          }
    </script>
</body>
</html>
